import React, { Component, Fragment } from 'react';
import { Tabs } from 'antd-mobile';
import { Card, WhiteSpace, Carousel, WingBlank } from 'antd-mobile';
import Home from './pape/Home'

const tabs = [
    { title: '首页', sub: '1' },
    { title: '商品', sub: '2' },
    { title: '购物栏', sub: '3' },
];


class App extends Component {

    constructor(props) {
        super(props)
        this.state = {
            inputValue: '',
        }
    }

    render() {
        return (
            <Fragment>
                <div className="col">
                    <div style={{ height: Audio }}>
                        <Tabs tabs={tabs} className="col" style={{ flexGrow: "2" }}
                            swipeable={false}
                            initialPage={1}
                            onChange={(tab, index) => { console.log('onChange', index, tab); }}
                            onTabClick={(tab, index) => { console.log('onTabClick', index, tab); }}
                        >
                            <div style={{ height: "100%", flexGrow: "5", backgroundColor: '#fff' }}>
                                <Home />
                            </div>
                            <div style={{ flexGrow: "2", backgroundColor: '#fff' }}>
                                Content of second tab
      </div>
                            <div style={{ flexGrow: "2", backgroundColor: '#fff' }}>
                                Content of third tab
      </div>
                        </Tabs>
                    </div>
                    <div style={{ flexGrow: "1" }}>
                        <WhiteSpace size="lg" />
                        <Card full>
                            <Card.Header
                                title="This is title"
                                thumb="https://gw.alipayobjects.com/zos/rmsportal/MRhHctKOineMbKAZslML.jpg"
                                extra={<span>this is extra</span>}
                            />
                            <Card.Body>
                                <div>This is content of `Card`</div>
                            </Card.Body>
                            <Card.Footer content="footer content" extra={<div>extra footer content</div>} />
                        </Card>
                    </div>

                </div>
            </Fragment>
        );
    }

}

export default App;
